import React from 'react'
import './Post.css';

const Post = (props) => {
    return (
        <div>
            <div className="post">
                <span className="postTitle">
                    {props.title}
                </span>
                <hr />
                <span className="postDate">  {new Date(props.updated_at).toDateString()}</span>
                <span className="postDate">  {new Date(props.updated_at).toDateString()}</span>

            <p className="postDesc">
                {props.message}
            </p>

            </div>
        </div>
    )
}

export default Post
